\r\n\r\n\r\n\r\n6. Key Skills - Process Automation, Power Conveyors Automation, Material Handling, Electrical Panels Manufacturing, Designing, and Development Team, Pneumatics, Hydraulics System Handling, FAT and SAT, Design Reviews, and Design Validation.\r\n\r\n\r\n\r\n7. Overall Industrial Experience and Qualification - 25+ years across India and Abroad Malaysia, Singapore, Sri Lanka, Bangladesh, Indian Railway, KORES Foundry\'s, PCL Cam-Shaft Solapur\r\n\r\n\r\n\r\n8. Total Project\'s Handlings 800+ Industrial Pilot Projects\r\n\r\nPlease go through our solutions/services document attached to this email.\r\n\r\n\r\nWe look forward to meeting you and presenting our experience and offerings at your earliest convenient time. Please let us know your suitable date and time slot for the meeting.\r\n\r\n\r\nThank you and Have a great day.\r\n\r\n\r\nRegards,\r\n\r\n\r\nRajendra B. Vaidya and Vivek B. Mahajan \r\n\r\nManaging Partners\r\n\r\nm: +91(0)9158623305 / +91(0)9822142387\r\ne:vivek.mahajan@viomepa.com/project.svac@gmail.com\r\n\r\n\r\nSiddhi Vinayak Automation & Consultant \r\n\r\nManufacturing all Types of LV Panels for MCC, PLC, VFD, IMCC and Special Purpose Panel\'s, having over 30+ years of Projects Engineering & Commissioning Experience.\r\nWe provide total automation solutions MCC, PLC, HMI, VFD Panel\'s, Servo Systems. AB, SIEMENS, DELTA, MITSUBISHI etc.. \r\n\r\nA1 Nimbaj Nagar, Suncity Road, opp.Santosh Hall, Ananadnagar, Sinhgad Road. Pune - 411051 \r\n\r\nGST 27AAIPV1646F1ZI \r\n\r\nEmail:\r\nproject.svac@gmail.com \r\n\r\nrajendrabvaidya150866@gmail.com\r\n\r\nDeccanchapter Member \r\n1. Industrial Automation Manufacturing \r\n2. Training and Placement for Engineer\'s CoE, and Corporate Industrial Automation\r\n3. Building, Office, Bunglow, Automation 2000 km control\r\n4. Professional Singer in Versatile \r\noverall 32years experience controls Stories, Thermax, Atlas-Copco, TaTa-Honeywell, Hyundai, Yamaha, Indian Railway, Defense, Norma, Dairy, Symbiosis, BEL, \r\nSpecific ask\r\nCore Industrial Contacts, Building,\r\nCoE, Corporates \r\n',NULL,'20230416_150128.jpg','2586','IMG-20230417-WA0000.jpg','2586','Screenshot_20230413_162110_Office.jpg','2586','Dairy Automation, Boiler Automation, Conveyors Automation, Heating and Cooling System, SPM','','',NULL,'2023-04-01','2024-03-31',1,NULL,0,0,'2023-10-10 22:02:49','2023-10-08 23:23:03'),
