(61,'2023-04-19',6,1616,'Done 1-2-1 with our Chapter Head Mr. Devdutt Bapat and the same was very interactive.\r\n\r\nMr. Devdutt Bapat has a Master\'s Degree in Management and has worked for shipping companies for 18 years. Since 2014, he\'s a teacher by profession and has been teaching 15+ subjects in Commerce stream at various levels.\r\n\r\n\r\nHe has experience of training approximately 185 students within the time span of 36 months. His concept of training is based upon demonstration and to make new drivers responsible for their own actions on the roads.\r\n\r\n\r\nMr. Dev trains students in such a way that after completion of training, they can easily drive their vehicles on any roads.\r\n\r\nHe eliminate the fear of driving and crowd from the mind of our students also  teach them Parking, Reverse Parking, Night drive, Highway drive and Incline Decline driving.\r\n\r\nHis services includes driving training, 2 wheeler as well as Bullet training. I wish Mr. Dev to fulfill his dream at the earliest. \r\n\r\nRecently he has started his 2nd vertical in event anchoring also. \r\n\r\nOn a personal front he is also a teacher, singer, marathon runner, badminton player, cricket player & above all a NCC Cadet.      \r\n It was nice and very encouraging to know the journey of Mr. Dev the Trainer. Thank you Mr. Dev for sparing your valuable business time for this meeting.','Accepted',NULL,'2023-05-01 12:06:02','2023-05-01 12:06:02',1951,1951),
(62,'2023-04-13',9,1709,'Today done 1-2-1 with Mr. Nitin Itraj - DC CrediSphereA.\r\n\r\nMr. Nitin Itraj is qualified Electronics Engineer and also completed in MBA in Business Management and also he has completed the course of computer programming.  He has huge experience in X Ray Machine manufacturing. His first and last job was in production for about 6 years. \r\nHe has also completed various training required for medical related subjects. In the year 1998 he quit as a Director from one of the reputed company in mfg. of X Ray machine and after that worked as a Consultant.\r\n\r\nIn the year 2008 he started Olympicks Medical Systems Manufacturer And Export Medical Equipment.\r\nOlympics Medicare systems was founded with a crave for perfection in design and development of unique quality x-ray machines and imaging systems. Rich medical experience in manufacturing of imaging systems & x-ray diagnostics system positioned it to the height of success in a very short of time.\r\n\r\nToday company is operating in the medical industry as a globally renowned manufacturer and exporter of a wide range of imaging systems & x-ray diagnostics system. These products are designed and developed adhering to international quality standard. Since inception, they have been able to maintain an exhaustive range of products, which caters to the medical manufacturing industry across all the vertical.\r\n\r\nAn OEM (original equipment manufacturer), have spearheaded the technological advances by incorporating modern technology in products and also created a massive base of satisfied customers through highly reliable and efficient services. At present, company exports of its products to overseas markets also.\r\n\r\nRecently they had developed full fledge hospital also. \r\n\r\nOn personal front Mr. Nitin likes to travel very much and are fond of various brands of wrist watches and also he is very good Tabla player.\r\n\r\n\r\nToday visited his factory also and gain very much information about his products and services. I wish all the best Mr. Nitin for his future journey.','Accepted',NULL,'2023-05-01 12:07:10','2023-05-01 12:07:10',1951,1951),
