(200,'2023-07-25',5,2385,'Sub: 1:1 Discussions with Mrs Saira Kale. \r\nDate: 25th Jul 2023.\r\nChapter: Thane\r\nCompany Name: Optima Knowledge Ventures LLP.\r\n\r\nI got a chance to meet Mrs Saira Kale madam for 1:1 discussion on 25th Jul after Thane chapter visitor day. She has done Masters in Computer Science and have worked in Canada for around 9 Years as Software Consultant and then in India for a few years. In her corporate career, she was a consultant for UI/UX development followed by SAP Development for several clients & delivered the projects successfully. Being a peoples person, along with the job she has worked as a Mentor or a Life Coach & helped several peoples, which remained her main passion.  \r\nIn 2021 she started her own business as a Career Coach and converted her passion into profession and started helping people of all age group like, Generation X, Millennials, Generation Z and school kids about their strengths, talents, areas to succeed and all possible options for an impactful career and a great life. She has a very broad horizon and lateral way of thinking. With those attributes and her assessment skills, she brings out the best of the person, shes consulting. She prefers to consult school kids, so that future of the kids can be shaped in a better way and in turn will give a satisfaction in life. I was amazed to know her success stories and her clients transformations & in turn achievements.      \r\nWe discussed each others hobbies, business areas, shared the experiences and decided to be in touch further. Thank you for your valuable time @ Saira Kale Madam and best wishes to achieve all the goals in life.\r\n\r\nAmeya D Atitkar	\r\nRigvon Technologies.\r\nCrediSphere Dombivli.','Accepted',NULL,'2023-07-26 18:04:57','2023-07-26 18:04:57',2349,2349),
(201,'2023-07-26',9,2313,'Today done 1-2-1 with Mr. Parikshit Deshpande\r\nProud owner of BRIILLIANT INTERIOR\r\nBRIILLIANT VAASTUU.\r\n\r\nParikshit Vijay Deshpande, member of CrediSphere Kalyan chapter, has vast experience of 26 years in the Interior and Vastushastra field.\r\n\r\nHe worked in two verticals as mentioned above.\r\n\r\nHe undertakes Turnkey Interior works for Residential structures like flats, Villas, Bungalows and in commercial places like Shops, Hotel, Restaurant, Bar, Resorts, Farmhouse, Offices and other commercial spaces. He works under 2 styles i.e. turnkey as well as only execution .\r\n\r\nHe also works as VAASTUSHASTRA CONSULTANT for residential and commercial Vastu.\r\n\r\n*His approach towards life is very positive after experiencing major ups and downs in his personal life. \r\nWhile interacting with him we can observe this quality in his behavior. He is a really nice person with huge knowledge and experience in his respective fields.*\r\n\r\nHe adds a very special USP in his business which is very unique for his clients.\r\n\r\nIn the future we will definitely work together for our own benefits and growth.\r\n\r\nThank you Mr. Parikshit Deshpande for sparing your valuable business time for this meeting. \r\n\r\nVivek Wamorkar\r\nDombivli chapter','Accepted',NULL,'2023-07-26 18:23:54','2023-07-26 18:23:54',1951,1951),
