(248,'2023-08-02',14,1742,'*Sub: 1:1 meeting with Mr Anand Chitale  Deccan Chapter & DC Pune Region*. \r\nDate: 2nd Aug 2023.\r\nCompany Name: *Aaradhya Enterprises*.\r\n*Business Area*: Turnkey Automation Projects. LED Lights, UPS/Inverters.\r\n*Target Customer Segment*: Special Purpose Machinery Manufacturers, Factory Owners. \r\n*Business incorporation*: 2016.\r\n*URL*: www.aaradhyaenterprises.in\r\n*Contact No: 9552777928*\r\n*Education*: B.E. Instrumentation. Post graduate diploma in Project Management.\r\n\r\n\r\nDuring my Pune visit, I got a chance to meet Mr. Anand Chitale in his office for 1:1 discussion. *A person with big heart*, I must say. He is a very jovial, calm nature & always smiling person. He thoroughly briefed me about all Pune chapters, its meeting schedules & the overall businesses & business segments in those chapters. \r\n\r\nBeing from same industrial sector we shared each others experiences, some knowledge & a lot of thought process to help each other. He also shown the different complex configuration Panels manufactured by him, for different customers. He has a thorough knowledge of Industry standards & practices. Because of his sincere business practices, he is a *trusted automation partner* for many customers.       \r\n My sincere best wishes to him for his great future & thank you so much for your valuable time.\r\n\r\nAmeya D Atitkar.\r\nRigvon Group.\r\n*Leadership Recruiter*.\r\nDombivli Chapter.\r\n','Accepted',NULL,'2023-08-07 21:54:50','2023-08-07 21:54:50',2349,2349),
